  false,\n\t\"url\": null,\n\t\"notes\": \"In 2004, the United States Fish and Wildlife
  Service (USFWS) designated the Guam National Wildlife Refuge as critical habitat
  for three species: the Mariana fruit bat (Pteropus mariannus mariannus), Micronesian
  Kingfisher (Halcyon cinnamomina cinnamomina), and the Mariana Crow (Corvus kubaryi),
  which have been extirpated from Guam primarily due to predation by the Brown Treesnake
  (Boiga irregularis, or BTS). In 2012 a multi-species barrier fence was constructed
  encompassing 51 ha; this fence includes a one-way barrier designed to exclude BTS
  from the refuge while allowing snakes on the refuge to leave the enclosed area.
  As currently deployed, the fence impedes ingress of snakes. The enclosed portions
  of the refuge are intended to be used for the recovery of native Guam wildlife.
  The focus of this trapping effort was to begin removing snakes from within the fenced
  area to assess the feasibility of localized snake suppression. We placed 100 snake
  traps along three transects, and checked traps weekly. Trapping commenced in February
  2013 and concluded in August 2013. We euthanized all captured BTS and recorded size,
  sex, and ingested prey items. Preliminary results indicate a strong trap decay rate
  in BTS trap captures over time. The positive relationship between body size and
  trap capture probability established by this and previous studies on BTS indicates
  that repeated treatment application would be necessary to suppress snakes as they
  grow into targetable size classes.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
